import './App.css';


class App extends Component{


  getLights = () => {
    let targetUrl = 'https://fierce-anchorage-55306.herokuapp.com/downloadmp3?url=https://www.youtube.com/watch?v=DHoUUveItfc';
    fetch(targetUrl)
      .then(response => response.json())
      .then(data => {
        console.log(data)
      })
      .catch(error => alert('Sorry the service is down \n:(\nPlease try again later'));
  }

  render() {
    return (
      <div className="App">
        {/* <audio  src="https://fierce-anchorage-55306.herokuapp.com/downloadmp3?url=https://www.youtube.com/watch?v=DHoUUveItfc" controls /> */}
      </div>
    );
  }

}






export default App;
